{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/marvinbulahan/entry-level-data-bi-analyst-roles-analysis?scriptVersionId=194236998\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"c0a0878b","metadata":{"papermill":{"duration":0.007594,"end_time":"2024-08-27T06:53:41.99849","exception":false,"start_time":"2024-08-27T06:53:41.990896","status":"completed"},"tags":[]},"source":["# Analysis on Job Postings for Entry-Level Data Analyst and BI Analyst Roles\n","**Author : Marvin Bulahan**"]},{"cell_type":"markdown","id":"3f4e186d","metadata":{"papermill":{"duration":0.006352,"end_time":"2024-08-27T06:53:42.011049","exception":false,"start_time":"2024-08-27T06:53:42.004697","status":"completed"},"tags":[]},"source":["# Introduction\n","- In todayâ€™s rapidly evolving job market, understanding the skills needed for Entry-Level Data Analyst and BI Analyst roles is crucial for aspiring and new professionals. This case study analyzes job postings from Indeed, Jobstreet, and Upwork to help create a learning plan tailored to the current market.\n","- Skills for these roles are constantly changing, especially with AI. There are many tools to learn, each requiring time to master. This study highlights the most in-demand skills and tools, providing guidance on planning an efficient learning path for the most relative skills and tools in the industry.\n","- Country of Interest : Philippines\n"]},{"cell_type":"markdown","id":"a90ed08d","metadata":{"papermill":{"duration":0.005945,"end_time":"2024-08-27T06:53:42.023273","exception":false,"start_time":"2024-08-27T06:53:42.017328","status":"completed"},"tags":[]},"source":["## Objectives, Methodology, and Tools\n","\n","| **Steps**               | **Description**                                                                                                       |\n","|-------------------------|-----------------------------------------------------------------------------------------------------------------------|\n","| **Primary Objectives**  | **Identify key trends and insights regarding skills, responsibilities, and qualifications across Data Analyst (DA), Business Intelligence (BI) Analyst, and other related roles. And Craft a Tailored learning Guide for the most used/required tools and skills** |\n","|                         | **Determine the most common values for soft skills and technical skills required for these positions.**               |\n","|                         | **Analyze the distribution of responsibilities and qualifications specific to each job category (Data Analyst, BI Analyst, and Other).** |\n","|                         | **Evaluate the relationship between work setups (Hybrid, Remote, On-Site) and required technical and soft skills.**   |\n","| **Secondary Objectives**| Examine how job setup (e.g., Hybrid, Remote, On-Site) impacts skill requirements and qualifications.                  |\n","|                         | Explore differences in job responsibilities and qualifications across various job categories.                         |\n","|                         | Compare benefits and qualifications associated with these positions.                                                  |\n","| **Methodology**         | **Summary Statistics**: Calculate average counts for qualifications, responsibilities, technical skills, soft skills, and benefits for each job category (DA, BI, Other). |\n","|                         | **Frequency Analysis**: Identify the most frequently occurring values for soft skills and technical skills.           |\n","|                         | **Categorical Analysis**: Group and compare responsibilities and qualifications across job categories (DA, BI, Other).|\n","|                         | **Work Setup Analysis**: Analyze soft skills and technical skills required for different work setups (Hybrid, Remote, On-Site). |\n","|                         | **Statistical Analysis**: Perform descriptive statistics to summarize key metrics across job categories.              |\n","|                         | **Visualization**: Develop charts and graphs to highlight trends and simplify data interpretation.                    |\n","|                         | **Reporting**: Compile findings into a comprehensive report with actionable insights.                                 |\n","| **Tools**               | [**PostgreSQL**](https://www.postgresql.org/) - For database creation, data collection, data preparation, and analysis. |\n","|                         | [**Tableau**](https://public.tableau.com/app/profile/entropy) - For visualizations and reporting.                      |\n","|                         | [**Kaggle R Notebook**](https://www.kaggle.com/marvinbulahan) - For publishing findings and sharing analyses.          |\n","|                         | [**dBDiagram.io**](https://dbdiagram.io/) - For schema diagram creation and management.                                |\n"]},{"cell_type":"markdown","id":"41751a82","metadata":{"papermill":{"duration":0.005852,"end_time":"2024-08-27T06:53:42.035127","exception":false,"start_time":"2024-08-27T06:53:42.029275","status":"completed"},"tags":[]},"source":["## Data Preparation\n","### Data Sources\n","- [**Indeed**](https://ph.indeed.com/) , [**Jobstreet**](https://www.jobstreet.com.ph/), [**Upwork**](https://www.upwork.com/)\n","\n","**Search Queries:** \n","- Data Analyst Entry Level, Data Analyst No Experience\n","- BI Analyst Entry Level, BI Analyst No Experience\n","\n","\n","## Database Creation\n","| Table Name         | Column Name               | Data Type     | Constraints                                    | Description                            |\n","|--------------------|----------------------------|---------------|------------------------------------------------|----------------------------------------|\n","| `jobs.job`         | job_id                     | SERIAL        | PRIMARY KEY                                     | Unique identifier for each job.        |\n","|                    | job_title                  | VARCHAR(255)  | NOT NULL                                        | Title of the job.                      |\n","|                    | location                   | VARCHAR(255)  | DEFAULT 'Unknown'                               | Location of the job.                   |\n","|                    | job_type                   | VARCHAR(50)   | DEFAULT 'Not Specified'                         | Type of job (e.g., Full-time, Part-time). |\n","|                    | setup                      | VARCHAR(50)   | CHECK (setup IN ('On-site', 'Hybrid', 'Remote')) | Work setup (e.g., On-site, Remote).     |\n","| `jobs.salary`      | salary_id                  | SERIAL        | PRIMARY KEY                                     | Unique identifier for salary records.  |\n","|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n","|                    | salary_min                 | DECIMAL(15, 2)| DEFAULT NULL                                    | Minimum salary for the job.            |\n","|                    | salary_max                 | DECIMAL(15, 2)| DEFAULT NULL                                    | Maximum salary for the job.            |\n","|                    | salary_currency            | VARCHAR(10)   | DEFAULT 'Unknown'                               | Currency of the salary.                |\n","| `jobs.responsibility` | responsibility_id         | SERIAL        | PRIMARY KEY                                     | Unique identifier for responsibilities.|\n","|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n","|                    | responsibility             | TEXT          |                                                | Description of the responsibility.     |\n","|                    | responsibility_description | TEXT          |                                                | Detailed description of the responsibility. |\n","|                    | responsibility_type        | VARCHAR(50)   |                                                | Type of responsibility (e.g., Core, Additional). |\n","|                    | phase                      | VARCHAR(20)   |                                                | Phase of the responsibility (e.g., Initial, Ongoing). |\n","| `jobs.soft_skill`  | soft_skill_id              | SERIAL        | PRIMARY KEY                                     | Unique identifier for soft skills.     |\n","|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n","|                    | soft_skill                 | VARCHAR(255)  |                                                | Name of the soft skill.                |\n","|                    | skill_description          | TEXT          |                                                | Description of the soft skill.         |\n","| `jobs.technical_skill` | technical_skill_id       | SERIAL        | PRIMARY KEY                                     | Unique identifier for technical skills.|\n","|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n","|                    | skill_description          | TEXT          |                                                | Description of the technical skill.    |\n","|                    | specific_tool              | VARCHAR(255)  |                                                | Tool associated with the skill.        |\n","|                    | category                  | VARCHAR(255)  |                                                | Category of the technical skill (e.g., Programming, Analysis). |\n","| `jobs.qualification` | qualification_id          | SERIAL        | PRIMARY KEY                                     | Unique identifier for qualifications.  |\n","|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n","|                    | qualification_type         | VARCHAR(50)   |                                                | Type of qualification (e.g., Degree, Certification). |\n","|                    | qualification_detail       | TEXT          |                                                | Detailed description of the qualification. |\n","|                    | required                   | BOOLEAN       | DEFAULT FALSE                                   | Whether the qualification is required. |\n","|                    | preferred                  | BOOLEAN       | DEFAULT FALSE                                   | Whether the qualification is preferred. |\n","| `jobs.benefit`     | benefit_id                 | SERIAL        | PRIMARY KEY                                     | Unique identifier for benefits.        |\n","|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n","|                    | benefit_description        | TEXT          | DEFAULT 'No benefits specified'                 | Description of the benefits offered.   |\n","| `jobs.schedule`    | schedule_id                | SERIAL        | PRIMARY KEY                                     | Unique identifier for schedules.       |\n","|                    | job_id                     | INT           | FOREIGN KEY REFERENCES jobs.job(job_id)        | Reference to job_id in jobs.job table. |\n","|                    | schedule_description       | TEXT          | DEFAULT 'No schedule specified'                 | Description of the schedule.           |\n"]},{"cell_type":"markdown","id":"cf8999ae","metadata":{"papermill":{"duration":0.006789,"end_time":"2024-08-27T06:53:42.048134","exception":false,"start_time":"2024-08-27T06:53:42.041345","status":"completed"},"tags":[]},"source":["## [SCHEMA Diagram](https://dbdiagram.io/d/66b1768b8b4bb5230e4d123f)"]},{"cell_type":"code","execution_count":1,"id":"6fd14de9","metadata":{"execution":{"iopub.execute_input":"2024-08-27T06:53:42.06409Z","iopub.status.busy":"2024-08-27T06:53:42.0619Z","iopub.status.idle":"2024-08-27T06:53:43.23041Z","shell.execute_reply":"2024-08-27T06:53:43.228252Z"},"papermill":{"duration":1.184388,"end_time":"2024-08-27T06:53:43.238438","exception":false,"start_time":"2024-08-27T06:53:42.05405","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAAcICAIAAAA3t21TAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzd2Y9d133o+bWnM9bMIlmUSIrUYFt2ZPsaSQe5uY3cvghwG0iCoBvIn5j3Bhp5\n6QCNuJP0DZKOY8uWNVPizGLNdeY99kNJNG1LNilRLJL784Eejoqndq0q6Zwq1vf81oqapgkA\nAAAAAABAO8SnvQAAAAAAAADg6REIAQAAAAAAoEUEQgAAAAAAAGgRgRAAAAAAAABaRCAEAAAA\nAACAFhEIAQAAAAAAoEUEQgAAAAAAAGgRgRAAAAAAAABaRCAEAAAAAACAFhEIAQAAAAAAoEUE\nQgAAAAAAAGgRgRAAAAAAAABaRCAEAAAAAACAFhEIAQAAAAAAoEUEQgAAAAAAAGgRgRAAAAAA\nAABaRCAEAAAAAACAFhEIAQAAAAAAoEUEQgAAAAAAAGgRgRAAAAAAAABaRCAEAAAAAACAFhEI\nAQAAAAAAoEUEQgAAAAAAAGgRgRAAAAAAAABaRCAEAAAAAACAFhEIAQAAAAAAoEUEQgAAAAAA\nAGgRgRAAAAAAAABaRCAEAAAAAACAFhEIAQAAAAAAoEUEQgAAAAAAAGgRgRAAAAAAAABaRCAE\nAAAAAACAFhEIAQAAAAAAoEUEQgAAAAAAAGgRgRAAAAAAAABaRCAEAAAAAACAFhEIAQAAAAAA\noEUEQgAAAAAAAGgRgRAAAAAAAABaRCAEAAAAAACAFhEIAQAAAAAAoEUEQgAAAAAAAGgRgRAA\nAAAAAABaRCAEAAAAAACAFhEIAQAAAAAAoEUEQgAAAAAAAGgRgRAAAAAAAABaRCAEAAAAAACA\nFhEIAQAAAAAAoEUEQgAAAAAAAGgRgRAAAAAAAABaRCAEAAAAAACAFhEIAQAAAAAAoEUEQgAA\nAAAAAGgRgRAAAAAAAABaRCAEAAAAAACAFhEIAQAAAAAAoEUEQgAAAAAAAGgRgRAAAAAAAABa\nRCAEAAAAAACAFhEIAQAAAAAAoEUEQgAAAAAAAGgRgRAAAAAAAABaRCAEAAA