n","# Load necessary library\n","library(png)\n","\n","# Read the image\n","img <- readPNG(\"/kaggle/input/schema-diagram/entry_level_jobs.png\")\n","\n","# Display the image\n","plot(1:2, type=\"n\", xlab=\"\", ylab=\"\", axes=FALSE)\n","rasterImage(img, 1, 1, 2, 2)"]},{"cell_type":"markdown","id":"711e69ce","metadata":{"papermill":{"duration":0.013596,"end_time":"2024-08-27T06:53:43.26635","exception":false,"start_time":"2024-08-27T06:53:43.252754","status":"completed"},"tags":[]},"source":["# Data Extraction\n","- Extracted raw CSV files of all tables from the database and uploaded them here.\n","\n","# Data Cleaning and Transformation\n","\n","1. **Job Table (Fact Table)**\n","    - **job_type**: \n","        - Removed unnecessary additional words after ',' using:  \n","          `UPDATE job SET job_type = split_part(job_type, ',', 1);`\n","        - Fixed capitalization using:  \n","          `UPDATE job SET job_type = INITCAP(job_type);`\n","        - Standardized \"Full Time\" to \"Full-Time\" using:  \n","          `UPDATE job SET job_type = REPLACE(job_type, 'Full Time', 'Full-Time');`\n","    - **setup**:\n","        - Fixed capitalization using:  \n","          `UPDATE job SET setup = INITCAP(setup);`\n","\n","2. **Benefit Table (Dimension Table)**\n","    - Added **category** column using:  \n","      `ALTER TABLE benefits ADD COLUMN IF NOT EXISTS category varchar(255);`\n","    - **category**: Categorized benefit descriptions using the following values:  \n","      \"Facilities and Equipment\", \"Compensation and Benefits\", \"Specific Projects and Experience\", \"Not Specified\", \"Time Off and Leave\", \"Financial and Retirement Planning\", \"Company Culture and Additional Perks\", \"Work Environment and Flexibility\", \"Career Development\", \"Health and Wellness\", \"Insurance\", \"Allowances and Miscellaneous\". Categorization was done using a `CASE` statement.\n","\n","3. **Qualification Table (Dimension Table)**\n","    - **qualification_type**: Standardized values using:\n","    ```sql\n","    UPDATE jobs.qualification \n","    SET qualification_type = CASE\n","        WHEN qualification_type ILIKE '%Experience%' THEN 'Experience'\n","        WHEN qualification_type ILIKE '%Background%' THEN 'Experience'\n","        WHEN qualification_type ILIKE '%Proficiency%' THEN 'Experience'\n","        WHEN qualification_type ILIKE '%Qualification%' THEN 'Education'\n","        WHEN qualification_type ILIKE '%Tool%' THEN 'Experience'\n","        WHEN qualification_type ILIKE '%Skill%' THEN 'Experience'\n","        WHEN qualification_type ILIKE '%Knowledge%' THEN 'Experience'\n","        WHEN qualification_type ILIKE '%Education%' THEN 'Education'\n","        WHEN qualification_type ILIKE '%Degree%' THEN 'Education'\n","        WHEN qualification_type ILIKE '%Cert%' THEN 'Education'\n","        WHEN qualification_type ILIKE '%Language%' THEN 'Language'\n","        ELSE qualification_type\n","    END;\n","    ```\n","\n","4. **Responsibility Table (Dimension Table)**\n","    - **phase**: Standardized values using:\n","    ```sql\n","    UPDATE jobs.responsibility \n","    SET phase = CASE\n","        WHEN phase = 'Train' THEN 'Other'\n","        WHEN phase = 'Document' THEN 'Prepare'\n","        WHEN phase = 'Learn' THEN 'Other'\n","        WHEN phase = 'Research' THEN 'Prepare'\n","        WHEN phase = 'Support' THEN 'Act'\n","        WHEN phase = 'Collect' THEN 'Prepare'\n","        WHEN phase = 'Verify' THEN 'Process'\n","        WHEN phase IN ('Others', 'Other') THEN 'Other'\n","        ELSE phase\n","    END;\n","    ```\n","\n","5. **Salary Table (Dimension Table)**\n","    - **salary_max**: Set `salary_max` NULL values to `salary_min` values if not NULL using:\n","    ```sql\n","    UPDATE jobs.salary \n","    SET salary_max = CASE\n","        WHEN salary_min IS NOT NULL THEN salary_min\n","    END;\n","    ```\n","\n","6. **Soft Skill Table (Dimension Table)**\n","    - Added **category** column and categorized the `soft_skill` column.\n","\n","7. **Technical Skill Table (Dimension Table)**\n","    - **specific_tool**: Needed to be restructured because some values contained multiple entries, which would hinder analysis. The steps were:\n","        1. Created a duplicate table.\n","        2. Deleted rows with multiple values in the duplicate table.\n","        3. Reassigned the `technical_skill_id` sequence because itâ€™s a serial key, then altered the sequence to follow the last number.\n","        4. Used the following query to split rows with multiple values and insert them into the duplicate table:\n","        ```sql\n","        INSERT INTO technical_skill_unnested (job_id, skill_description, specific_tool, category)\n","        SELECT job_id, skill_description, specific_tool, category\n","        FROM (\n","            SELECT\n","                job_id,\n","                skill_description,\n","                unnest(string_to_array(specific_tool, ',')) AS specific_tool,\n","                category\n","            FROM technical_skill\n","            WHERE specific_tool ILIKE '%,%'\n","        ) AS unnested;\n","        ```\n","        5. Deleted the original table.\n","    - **category**: Standardized categories using these values: \"Business Intelligence & Reporting\", \"Project Management & Miscellaneous\", \"Programming & Development\", \"CRM & Support\", \"Database Management\", \"Software & Tools\", \"Certification\", \"Automation & ETL\", \"Finance & Accounting\", \"Data Analysis & Research\", \"Testing & Quality Assurance\".\n"]},{"cell_type":"markdown","id":"5dd8099c","metadata":{"papermill":{"duration":0.012876,"end_time":"2024-08-27T06:53:43.292096","exception":false,"start_time":"2024-08-27T06:53:43.27922","status":"completed"},"tags":[]},"source":["# Data Analysis\n","\n","## 1. Summary Statistics\n","\n","### Average Counts of Skills and Attributes\n","\n","The following SQL query calculates the average counts of various attributes (qualifications, responsibilities, soft skills, technical skills, and benefits) for different job categories (BI Analyst, Data Analyst, Others):\n","\n","```sql\n","WITH counts AS (\n","    SELECT\n","        CASE \n","            WHEN job_title LIKE '%Business%' OR job_title LIKE '%BI%' THEN 'BI Analyst'\n","            WHEN (job_title LIKE '%Analyst%' OR job_title LIKE '%Analysis%' OR job_title LIKE '%Analytics%')\n","                 AND NOT (job_title LIKE '%Business%' OR job_title LIKE '%BI%') THEN 'Data Analyst'\n","            ELSE 'Others'\n","        END AS job,\n","        COUNT(DISTINCT q.qualification_id) AS qualification_count,\n","        COUNT(DISTINCT r.responsibility_id) AS responsibility_count,\n","        COUNT(DISTINCT s.soft_skill_id) AS soft_skill_count,\n","        COUNT(DISTINCT t.technical_skill_id) AS technical_skill_count,\n","        COUNT(DISTINCT b.benefit_id) AS benefit_count\n","    FROM job AS j\n","    LEFT JOIN qualification AS q USING(job_id)\n","    LEFT JOIN responsibility AS r USING(job_id)\n","    LEFT JOIN soft_skill AS s USING(job_id)\n","    LEFT JOIN technical_skill_unnested AS t USING(job_id)\n","    LEFT JOIN benefit AS b USING(job_id)\n","    GROUP BY job_id\n",")\n","\n","SELECT\n","    job,\n","    COUNT(job) AS job_count,\n","    ROUND(AVG(qualification_count)) AS avg_qualifications,\n","    ROUND(AVG(responsibility_count)) AS avg_responsibilities,\n","    ROUND(AVG(soft_skill_count)) AS avg_soft_skills,\n","    ROUND(AVG(technical_skill_count)) AS avg_technical_skills,\n","    ROUND(AVG(benefit_count)) AS avg_benefit\n","FROM counts\n","GROUP BY job;\n","\n","result -> /kaggle/input/extract-1/AVG.csv\n","```"]},{"cell_type":"code","execution_count":2,"id":"db333e50","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2024-08-27T06:53:43.350029Z","iopub.status.busy":"2024-08-27T06:53:43.319652Z","iopub.status.idle":"2024-08-27T06:53:43.970243Z","shell.execute_reply":"2024-08-27T06:53:43.968459Z"},"papermill":{"duration