pe":"display_data"}],"source":["# Read the image\n","img <- readPNG(\"/kaggle/input/extract-1/tech_cat.png\")\n","\n","# Display the image\n","plot(1:2, type=\"n\", xlab=\"\", ylab=\"\", axes=FALSE)\n","rasterImage(img, 1, 1, 2, 2)"]},{"cell_type":"markdown","id":"eb0827d2","metadata":{"papermill":{"duration":0.029176,"end_time":"2024-08-27T06:53:47.006331","exception":false,"start_time":"2024-08-27T06:53:46.977155","status":"completed"},"tags":[]},"source":["## 3. Job Title Analysis\n","\n","### Responsibilities\n","\n","The following SQL query analyzes job responsibilities by job title, providing a count of responsibilities grouped by job title and phase:\n","\n","```sql\n","WITH job_title AS (\n","    SELECT \n","        job_id,\n","        CASE \n","            WHEN job_title LIKE '%Business%' OR job_title LIKE '%BI%' THEN 'BI Analyst'\n","            WHEN (job_title LIKE '%Analyst%' OR job_title LIKE '%Analysis%' OR job_title LIKE '%Analytics%')\n","                 AND NOT (job_title LIKE '%Business%' OR job_title LIKE '%BI%') THEN 'Data Analyst'\n","            ELSE 'Others'\n","        END AS job\n","    FROM jobs.job\n",")\n","\n","SELECT \n","    j.job, \n","    r.phase, \n","    COUNT(r.phase) AS responsibility_count\n","FROM \n","    jobs.responsibility AS r\n","INNER JOIN \n","    job_title AS j\n","USING(job_id)\n","GROUP BY \n","    j.job, \n","    r.phase\n","ORDER BY \n","    j.job, \n","    r.phase;\n","\n","result -> /kaggle/input/extract-2/job_responsibilities.csv\n","```"]},{"cell_type":"markdown","id":"ede64f7f","metadata":{"papermill":{"duration":0.03045,"end_time":"2024-08-27T06:53:47.066081","exception":false,"start_time":"2024-08-27T06:53:47.035631","status":"completed"},"tags":[]},"source":["### Responsibilities (Wide Format for Visualization)\n","\n","The following SQL query transforms the job responsibilities data into a wide format suitable for visualization. This format provides a matrix of job titles against various responsibility phases:\n","\n","```sql\n","SELECT *\n","FROM crosstab(\n","    $$\n","    SELECT \n","        CASE \n","            WHEN j.job_title LIKE '%Business%' OR j.job_title LIKE '%BI%' THEN 'BI Analyst'\n","            WHEN (j.job_title LIKE '%Analyst%' OR j.job_title LIKE '%Analysis%' OR j.job_title LIKE '%Analytics%')\n","                 AND NOT (j.job_title LIKE '%Business%' OR j.job_title LIKE '%BI%') THEN 'Data Analyst'\n","            ELSE 'Others'\n","        END AS job,\n","        r.phase,\n","        COUNT(r.phase) AS responsibility_count\n","    FROM responsibility AS r\n","    INNER JOIN job AS j ON r.job_id = j.job_id\n","    GROUP BY job, r.phase\n","    ORDER BY job, r.phase\n","    $$,\n","    $$\n","    SELECT DISTINCT phase\n","    FROM responsibility\n","    ORDER BY phase\n","    $$\n",") AS ct(\n","    job VARCHAR,\n","    \"Ask\" INT,\n","    \"Prepare\" INT,\n","    \"Process\" INT,\n","    \"Analyze\" INT,\n","    \"Share\" INT,\n","    \"Act\" INT,\n","    \"Other\" INT\n",");\n","\n","```"]},{"cell_type":"code","execution_count":7,"id":"9aaefb8a","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2024-08-27T06:53:47.128782Z","iopub.status.busy":"2024-08-27T06:53:47.127207Z","iopub.status.idle":"2024-08-27T06:53:47.70054Z","shell.execute_reply":"2024-08-27T06:53:47.697908Z"},"papermill":{"duration":0.607977,"end_time":"2024-08-27T06:53:47.703953","exception":false,"start_time":"2024-08-27T06:53:47.095976","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdaZMcR57nd3eP+8g7s+7CRfBqsjlHrzRak8lsTPtMerky0wOZrdmuyWSymdVu\nz/Q2m8MmQYIo1J2VZ2TcEa4HARSL4AGQjQYIxPfzDFVRkY44PNL8F393qbUWAAAAAAAAAAAA\nANpBve4GAAAAAAAAAAAAAHh1CAgBAAAAAAAAAACAFiEgBAAAAAAAAAAAAFqEgBAAAAAAAAAA\nAABoEQJCAAAAAAAAAAAAoEUICAEAAAAAAAAAAIAWISAEAAAAAAAAAAAAWoSAEAAAAAAAAAAA\nAGgRAkIAAAAAAAAAAACgRQgIAQAAAAAAAAAAgBYhIAQAAAAAAAAAAABahIAQAAAAAAAAAAAA\naBECQgAAAAAAAAAAAKBFCAgBA