AND q.preferred THEN 1 END) AS exp_preferred,\n","    COUNT(CASE WHEN q.qualification_type = 'Education' AND q.required THEN 1 END) AS educ_required,\n","    COUNT(CASE WHEN q.qualification_type = 'Education' AND q.preferred THEN 1 END) AS educ_preferred\n","FROM \n","    job AS j\n","INNER JOIN \n","    qualification AS q USING (job_id)\n","GROUP BY \n","    job\n","ORDER BY \n","    job;\n","\n","result -> /kaggle/input/extract-2/job_qualifications.csv\n","```"]},{"cell_type":"code","execution_count":8,"id":"f201d544","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2024-08-27T06:53:47.830014Z","iopub.status.busy":"2024-08-27T06:53:47.828493Z","iopub.status.idle":"2024-08-27T06:53:48.506963Z","shell.execute_reply":"2024-08-27T06:53:48.504223Z"},"papermill":{"duration":0.713603,"end_time":"2024-08-27T06:53:48.510493","exception":false,"start_time":"2024-08-27T06:53:47.79689","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzd2bMcx6Hn98ysvXrfzw6AALhpu75LTNxwTIwj5m3+YL84xmGHw+GwZ67mSpRE\nUgSxnbVP70tV155+KODwkKBEEIIEgfX9BB7Yh71kV2VlVeevMlNqrQUAAAAAAAAAAACAalDv\nugAAAAAAAAAAAAAA/nYICAEAAAAAAAAAAIAKISAEAAAAAAAAAAAAKoSAEAAAAAAAAAAAAKgQ\nAkIAAAAAAAAAAACgQggIAQAAAAAAAAAAgAohIAQAAAAAAAAAAAAqhIAQAAAAAAAAAAAAqBAC\nQgAAAAAAAAAAAKBCCAgBAAAAAAAAAACACiEgBAAAAAAAAAAAACqEgBAAAAAAAAAAAACoEAJC\nAAAAAAAAAAAAoEIICAEAAAAAAAAAAIAKISAEAAAAAAAAAAAAKoSAEAAAAAAAAAAAAKgQAkIA\nAAAAAAAAAACgQggIAQAAAAAAAAAAgAohIAQAAAAAAAAAAAAqhIAQAAAAAAAAAAAAqBACQgAA\nAAAAAAAAAKBCCAgBAAAAAAAAAACACiEgBAAAAAAAAAAAACqEgBAAAAAAAAAAAACoEAJCAAAA\nAAAAAAAAoEIICAEAAAAAAAAAAIAKISAEAAAAAAAAAAAAKoSAEAAAAAAAAAAAAKgQAkIAAAAA\nAAAAAACgQggIAQAAAAAAAAAAgAohIAQAAAAAAAAAAAAqhIAQAAAAAAAAAAAAqBACQgAAAAAA\nAAAAAKBCCAgBAAAAAAAAAACACiEgBAAAAAAAAAAAACqEgBAAAAAAAAAAAACoEAJCAAAAAAAA\nAAAAoEIICAEAAAAAAAAAAIAKISAEAAAAAAAAAAAAKoSAEAAAAAAAAAAAAKgQAkIAAAAAAAAA\nAACgQggIAQAAAAAAAAAAgAohIAQAAAAAAAAAAAAqhIAQAAAAAAAAAAAAqBACQg