EAIAAAAAAECICIQAAAAAAAAQIgIhAAAAAAAAhMj/DxdBrkhT45JQAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":600,"width":1200}},"output_type":"display_data"}],"source":["# Read the image\n","img <- readPNG(\"/kaggle/input/extract-2/job_qualification.png\")\n","\n","# Display the image\n","plot(1:2, type=\"n\", xlab=\"\", ylab=\"\", axes=FALSE)\n","rasterImage(img, 1, 1, 2, 2)"]},{"cell_type":"markdown","id":"23d10ebd","metadata":{"papermill":{"duration":0.03176,"end_time":"2024-08-27T06:53:48.575951","exception":false,"start_time":"2024-08-27T06:53:48.544191","status":"completed"},"tags":[]},"source":["## 4.Job Setup Analysis\n","\n","#### Identifying Soft Skills for Each Job Setup\n","\n","The following SQL query counts the occurrences of various soft skill categories for each job setup. It provides insights into how different setups (e.g., Hybrid, Remote, On-Site) relate to specific soft skills:\n","\n","```sql\n","SELECT \n","    j.setup,\n","    COUNT(CASE WHEN s.category ILIKE '%Self-Management%' THEN 1 END) AS \"Self-Management and Confidence\",\n","    COUNT(CASE WHEN s.category ILIKE '%Teamwork%' THEN 1 END) AS \"Teamwork and Collaboration\",\n","    COUNT(CASE WHEN s.category ILIKE '%Analytical%' THEN 1 END) AS \"Analytical Thinking\",\n","    COUNT(CASE WHEN s.category ILIKE '%Flexibility and Adaptability%' THEN 1 END) AS \"Flexibility and Adaptability\",\n","    COUNT(CASE WHEN s.category ILIKE '%Leadership%' THEN 1 END) AS \"Leadership and Initiative\",\n","    COUNT(CASE WHEN s.category ILIKE '%Learning and Adaptability%' THEN 1 END) AS \"Learning and Adaptability\",\n","    COUNT(CASE WHEN s.category ILIKE '%Time%' THEN 1 END) AS \"Time Management and Prioritization\",\n","    COUNT(CASE WHEN s.category ILIKE '%Communication%' THEN 1 END) AS \"Communication Skills\",\n","    COUNT(CASE WHEN s.category ILIKE '%Teaching%' THEN 1 END) AS \"Teaching and Learning\",\n","    COUNT(CASE WHEN s.category ILIKE '%Detail%' THEN 1 END) AS \"Detail Orientation and Organization\",\n","    COUNT(CASE WHEN s.category ILIKE '%Innov%' THEN 1 END) AS \"Innovation and Problem Solving\",\n","    COUNT(CASE WHEN s.category ILIKE '%Other%' THEN 1 END) AS \"Other\",\n","    COUNT(CASE WHEN s.category ILIKE '%Customer%' THEN 1 END) AS \"Customer Service and Administration\",\n","    COUNT(CASE WHEN s.category ILIKE '%Multitasking%' THEN 1 END) AS \"Multitasking and Organization\",\n","    COUNT(CASE WHEN s.category ILIKE '%Technical and Documentation%' THEN 1 END) AS \"Technical and Documentation\",\n","    COUNT(CASE WHEN s.category ILIKE '%Focus%' THEN 1 END) AS \"Focus, Reliability and Professionalism\",\n","    COUNT(CASE WHEN s.category ILIKE '%Project%' THEN 1 END) AS \"Project Management and Planning\"\n","FROM \n","    job AS j\n","LEFT JOIN \n","    soft_skill AS s USING(job_id)\n","WHERE \n","    j.setup != 'Not Specified'\n","GROUP BY \n","    j.setup;\n","    \n","   result -> /kaggle/input/extract-3/setup_soft_skill.csv\n","   ```"]},{"cell_type":"code","execution_count":9,"id":"f7b7af11","metadata":{"execution":{"iopub.execute_input":"2024-08-27T06:53:48.648808Z","iopub.status.busy":"2024-08-27T06:53:48.646461Z","iopub.status.idle":"2024-08-27T06:53:49.406263Z","shell.execute_reply":"2024-08-27T06:53:49.404302Z"},"papermill":{"duration":0.800903,"end_time":"2024-08-27T06:53:49.410262","exception":false,"start_time":"2024-08-27T06:53:48.609359","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzd53cbZ4Lv+adyLmQCBHOQqODQbs/0zNx77p577uzZF/u/7ts9e+/u9JmZ7mm3\nbdnKgSIp5kwihwJQYV+URMsKlsaWpZbx/bwjCQIFoKqe8HuClCSJAAAAAAAAAAAAADAe5A99\nAAAAAAAAAAAAAADeHwJCAAAAAAAAAAAAYIwQEAIAAAAAAAAAAABjhIAQAAAAAAAAAAAAGCME\nhAAAAAAAAAAAAMAYISAEAAAAAAAAAAAAxggBIQAAAAAAAAAAADBGCAgBAAAAAAAAAACAMUJA\nCAAAAAAAAAAAAIwRAkIAAAAAAAAAAABgjBAQAgAAAAAAAAAAAGOEgBAAAAAAAAAAAAAYIwSE\nAAAAAAAAAAAAwBghIAQAAAAAAAAAAADGCAEhAAAAAAAAAAAAMEYICAEAAAAAAAAAAIAxQkAI\nAAAAAAAAAAA