},{"cell_type":"markdown","id":"d024810c","metadata":{"papermill":{"duration":0.036991,"end_time":"2024-08-27T06:53:49.491452","exception":false,"start_time":"2024-08-27T06:53:49.454461","status":"completed"},"tags":[]},"source":["### Technical Skills for Each Job Setup\n","\n","This query counts the occurrences of various technical skills for each job setup. It provides insights into how different setups (e.g., Hybrid, Remote, On-Site) relate to specific technical skills:\n","\n","```sql\n","SELECT \n","    j.setup,\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%R%' THEN 1 END) AS \"R\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%Microsoft Excel%' THEN 1 END) AS \"Microsoft Excel\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%SQL%' THEN 1 END) AS \"SQL\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%Power BI%' THEN 1 END) AS \"Power BI\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%Tableau%' THEN 1 END) AS \"Tableau\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%Python%' THEN 1 END) AS \"Python\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%Microsoft Office%' THEN 1 END) AS \"Microsoft Office\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%Google Sheets%' THEN 1 END) AS \"Google Sheets\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%Microsoft SQL Server%' THEN 1 END) AS \"Microsoft SQL Server\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%Confluence%' THEN 1 END) AS \"Confluence\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%Google Data Studio%' THEN 1 END) AS \"Google Data Studio\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%MySQL%' THEN 1 END) AS \"MySQL\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%DAX%' THEN 1 END) AS \"DAX\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%Pandas%' THEN 1 END) AS \"Pandas\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%ETL%' THEN 1 END) AS \"ETL\",\n","    COUNT(CASE WHEN t.specific_tool ILIKE '%Optimal Blue%' THEN 1 END) AS \"Optimal Blue\",\n","    COUNT(CASE WHEN t.specifi